import React, { use} from "react";
import UserProvider from "../hooks/useUsers";
import FavoriteProvider, { FavoriteContext } from "../hooks/useFavorite";

const SelectedPage = () => {
    const favorite = useContext(FavoriteContext);
    return (
        <>
            <UserProvider>
                <FavoriteProvider>
                    <h1>SelectedPage</h1>
                </FavoriteProvider>
            </UserProvider>
        </>
    );
};

export default SelectedPage;
